# Main Logic Code:

.text
.globl main

main:

# Load Start Screen with the play button:
start_screen:
    # Set up arguments for display_Screen function 
    la $a0, start_screen_play 
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call the display_Screen function
    jal display_Screen
    
    check:
    	li $t9, 0xffff0000
    	lw $t8, 0($t9)
    	beq $t8, 1, keypress
    	j check
     
     keypress:
     	lw $t2, 4($t9)
     	beq $t2, 0x73, start_screen_exit
     	beq $t2, 0x0A, print_level
     	j check
     	
 
# Load Start screen with the exit button:
start_screen_exit:
    # Set up arguments for display_Screen function
    la $a0, start_screen_quit  
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_Screen function
    jal display_Screen
    
    check_quit:
    	li $t9, 0xffff0000
    	lw $t8, 0($t9)
    	beq $t8, 1, keypress_quit
    	j check_quit
     
     keypress_quit:
     	lw $t2, 4($t9)
     	beq $t2, 0x77, start_screen
     	beq $t2, 0x0A, exit
     	j check_quit
    
    
# Load Level 1:
start_level:
    # Set up arguments for display_Screen function
    la $a0, level_one   
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         
    
    la $t3, CharX
    li $t4, 4
    sw $t4, 0($t3)
    la $t3, OldX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, OldY
    li $t4, 62
    sw $t4, 0($t3)
    la $t3, CharY
    li $t4, 62
    sw $t4, 0($t3)
    
    # Call display_Screen
    jal display_Screen
    jal draw_panda
    
    j print_health


# Load Level 2:
second_level:
    # Set up arguments for display_Screen function
    la $a0, level_two 
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    la $t3, CharX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, CharY
    li $t4, 62
    sw $t4, 0($t3)
    
    la $t3, OldX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, OldY
    li $t4, 62
    sw $t4, 0($t3)
    
    # Call display_Screen
    jal display_Screen
    jal draw_panda
    
    # Update the screen value to 2
    li $t0, 2            # Load the value 2 into $t0
    sw $t0, Screen       # Store the value 2 at the address of Screen
    
    j print_health


# Load Level 3:
third_level:
    # Set up arguments for display_Screen function
    la $a0, level_three 
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    la $t3, CharX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, CharY
    li $t4, 61
    sw $t4, 0($t3)
    
    la $t3, OldX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, OldY
    li $t4, 61
    sw $t4, 0($t3)
    
    # Call display_Screen
    jal display_Screen
    jal draw_panda
    
    li $t0, 3            # Load the value 3 into $t0
    sw $t0, Screen       # Store the value 3 at the address of Screen
    
    j print_health


# Level Update:
next_level:
    # Increase level by 1
    la $t0, Screen    
    # Load the address of Screen into $t0
    lw $t1, 0($t0)    
    # Load the value stored at health into $t1
    addi $t1, $t1, 1  
    # Increase the value in $t1 by 1
    sw $t1, 0($t0)    
    # Store the updated value in $t1 back to Screen

print_level:
    lw $t0, Screen        
    # Load the value of level into $t0

    li $t1, 1            
    # Load the value 1 into $t1
    beq $t0, $t1, start_level 
    # If level == 1, go to start_level

    li $t1, 2            
    # Load the value 2 into $t1
    beq $t0, $t1, second_level 
    # If level == 2, go to second_level

    li $t1, 3            
    # Load the value 3 into $t1
    beq $t0, $t1, third_level  
    # If level == 3, go to third_level
    
    li $t1, 4            
    # Load the value 4 into $t1
    beq $t0, $t1, win    
    # If level == 4, go to the win screen
    
    j game_loop
    
print_health:
    # Decrement health by 1
    lw $t0, Health    
    # Load the address of health into $t0
    
    beq $t0, 3, print_3_hearts
    beq $t0, 2, print_2_hearts
    beq $t0, 1, print_1_heart
    
print_3_hearts:
    # draw it
    # Set up the arguments for display_Screen
    la $a0, three_hearts    
    # Replace image_start with the label of the image data in memory
    li $a1, 29           
    li $a2, 11 
    li $t0, 96
    li $t1, 3     

    # Call display_Screen
    jal display_Screen
    
    j game_loop
    
print_2_hearts:
    # draw it 
    # Set up the arguments for display_Screen
    la $a0, two_hearts    
    # Replace image_start with the label of the image data in memory
    li $a1, 29           
    li $a2, 11 
    li $t0, 96
    li $t1, 3        

    # Call display_Screen
    jal display_Screen
    
    j game_loop
    
print_1_heart:
    # draw it
    # Set up the arguments for display_Screen
    la $a0, one_heart    
    # Replace image_start with the label of the image data in memory
    li $a1, 29           
    li $a2, 11 
    li $t0, 96
    li $t1, 3        

    # Call display_Screen
    jal display_Screen
    
    j game_loop
    
# Game Loop:
game_loop:
    j check_press

    inner_loop:
	la $t0, character_movement  
	# Load the address of character_movement array into $t0
    	lw $t7, 0($t0)        	    
    	# Load the value of character_movement[0] into $t1
    	lw $t8, 4($t0)        	    
    	# Load the value of character_movement[1] into $t2
    	lw $t3, 12($t0)        	    
    	# Load the value of character_movement[3] into $t3
    	
    	lw $t0, Screen
    	li $t1, 3            
    	# Load the value 3 into $t1
        beq $t0, $t1, print_skull  
        # If level == 3, go to print skull
        
    	continue:
	bnez $t7, move_left  
	# If character_movement[0] is not zero, call move_left
    	bnez $t8, move_right 
    	# If character_movement[1] is not zero, call move_right
    	
    	game_vertical:
    	la $t0, character_movement  
    	# Load the address of character_movement array into $t0
    	lw $t3, 12($t0)        	    
    	# Load the value of character_movement[3] into $t3
    	bnez $t3, move_down  
    	# If character_movement[3] is not zero, call move_down
    	beqz $t3, move_up    
    	# If character_movement[3] is zero, call move_up
	
	sleep:
	
	jal erase_panda 
	# erase character in current position
	jal draw_panda
	lw $t0, CharX      
	# Load the value of "CharX" into register $t0
	lw $t1, CharY      
	# Load the value of "CharY" into register $t1
	sw $t0, OldX       
	# Store the value in $t0 to "OldX" in memory
	sw $t1, OldY       
	# Store the value in $t1 to "OldY" in memory
	
	# Sleep for 40ms 
	li $v0, 32
	li $a0, 40
	syscall
	
	j game_loop
	

# Damage Taken from falling into water or hitting the skull:
damage_taken:
    # Decrement health by 1
    
    la $t0, Health    
    # Load the address of health into $t0
    lw $t1, 0($t0)    
    # Load the value stored at health into $t1
    addi $t1, $t1, -1 
    # Decrement the value in $t1 by 1
    beqz $t1, game_over
    sw $t1, 0($t0)    
    # Store the updated value in $t1 back to health
    
    j print_level



# Exit Code:
game_over:
    # Set up the arguments for display_Screen
    la $a0, game_over_screen   
    # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_Screen
    jal display_Screen
    # Exit program
    j check_win
    
win:
    # Set up the arguments for display_Screen
    la $a0, win_screen   
    # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_Screen
    jal display_Screen
    
    check_win:
    	li $t9, 0xffff0000
    	lw $t8, 0($t9)
    	beq $t8, 1, keypress_win
    	j check_win
     
     keypress_win:
     	lw $t2, 4($t9)
     	beq $t2, 0x70, respond_to_p
     	j check_win
    
exit:
    # Draw black screen
    # Set up the arguments for display_Screen
    la $a0, black_screen   
    # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_Screen
    jal display_Screen
    # Exit program
    li $v0, 10
    syscall
    
# Control Functions:
    
check_press:
	# Fetch keyboard input
	li $t9, 0xffff0000
	lw $t1, 0($t9)
	beq $t1, 1, check_keypress_happened
	j inner_loop

# Which key pressed: 
check_keypress_happened:
	
	lw $t2, 4($t9)

	# Check if 'a' is pressed
	li $t4, 0x61 # ASCII code for 'a'
	beq $t2, $t4, respond_to_a

	# Check if 'd' is pressed
	li $t4, 0x64 # ASCII code for 'd'
	beq $t2, $t4, respond_to_d

	# Check if 'w' is pressed
	li $t4, 0x77 # ASCII code for w
	beq $t2, $t4, respond_to_w
	
	# Check if 's' is pressed
    	li $t4, 0x73 # ASCII code for 's'
    	beq $t2, $t4, respond_to_s

	# Check if 'p' is pressed
	li $t4, 0x70 # ASCII code for 'p'
	beq $t2, $t4, respond_to_p
	
	j end_of_actions

# Response to key Press
respond_to_a:
    # Actions for 'a' keypress
    la $t0, character_movement  	
    # Load the address of character_movement array into $t0
    li $t1, 1
    sw $zero, 4($t0)  	
    # Set character_movement[1] to 1 (right enabled on)
    sw $t1, 0($t0)    	
    # Set character_movement[0] to 0 (left enabled on)
    
    move_left:
    	# left collisions
    	# Check for right collisions
    	lw $t0, CharX
    	lw $t1, CharY
    	
    	beq $t0, 0, game_vertical
    	
    	add $t1, $t1, CHAR_HEIGHT
    	addi $t1, $t1, -1
    	addi $t0, $t0, -1
    	li $t2, 0x10008000   	
    	# Load the base address of the bitmap
    	mul $t3, $t1, 128    	
    	# Calculate y_offset = y_position * 512
    	add $t3, $t3, $t0    	
    	# Calculate total_offset = y_offset + x_position
    	mul $t3, $t3, 4	 	
    	# starting address = total_offset * 4
    	add $t2, $t2, $t3    	
    	# Add the total_offset to the base address
	
    	li $t5, 0             	
    	# Initialize the loop counter

	check_pixels_loop_left:
    	ble $t5, -7168, next_left  	
    	# If the loop counter <= -7168, jump to game_vertical

    	lw $t4, 0($t2)           	
    	# Set $t4 to the value of the pixel at the top left
    	bne $t4, 0x00000000, game_vertical
    	addi $t2, $t2, -512      	
    	# Move to the next pixel on the left
    	addi $t5, $t5, -512      	
    	# Decrement the loop counter by -512
   	 j check_pixels_loop_left 	
   	 # Jump back to check_pixels_loop_right
	
	
    	next_left:
    
    	la $t0, CharX   	
    	# Load the address of CharX into $t0
    	lw $t1, 0($t0)  	
    	# Load the value stored at CharX into $t1
    	addi $t1, $t1, -1 	
    	# Increment the value in $t1 by -1
    	sw $t1, 0($t0)  	
    	# Store the updated value in $t1 back to CharX
    	
    
    j game_vertical

respond_to_d:
    # Actions for 'd' keypress
    la $t0, character_movement  	
    # Load the address of character_movement array into $t0
    li $t1, 1
    sw $zero, 0($t0)    		
    # Set character_movement[1] to 1 (left enabled off)
    sw $t1, 4($t0)  			
    # Set character_movement[0] to 0 (right enabled off)
    
    move_right:
    	# Check for right collisions
    	lw $t0, CharX
    	lw $t1, CharY
    	
    	beq $t0, 119, game_vertical
    	
    	add $t0, $t0, CHAR_WIDTH
    	add $t1, $t1, CHAR_HEIGHT
    	addi $t1, $t1, -1
    	li $t2, 0x10008000   		
    	# Load the base address of the bitmap
    	mul $t3, $t1, 128    		
    	# Calculate y_offset = y_position * 512
    	add $t3, $t3, $t0    	
    	# Calculate total_offset = y_offset + x_position
    	mul $t3, $t3, 4	 		
    	# starting address = total_offset * 4
    	add $t2, $t2, $t3    		
    	# Add the total_offset to the base address
	
	li $t5, 0                	
	# Initialize the loop counter

	check_pixels_loop_right:
    	ble $t5, -7168, next 		
    	# If the loop counter <= -7168, jump to game_vertical

    	lw $t4, 0($t2)           	
    	# Set $t4 to the value of the pixel at the top right
    	
    	beq $t4, 0x00d50000, damage_taken
    	bne $t4, 0x00000000, game_vertical
    	addi $t2, $t2, -512      	
    	# Move to the next pixel on the left
    	addi $t5, $t5, -512      	
    	# Decrement the loop counter by -512
   	 j check_pixels_loop_right 	
   	 # Jump back to check_pixels_loop_right
	
    	next:
    	# Move right
    	la $t0, CharX   		
    	# Load the address of CharX into $t0
    	lw $t1, 0($t0)  		
    	# Load the value stored at CharX into $t1
    	addi $t1, $t1, 1 		
    	# Increment the value in $t1 by 1
    	sw $t1, 0($t0)  		
    	# Store the updated value in $t1 back to CharX
    	
    
    j game_vertical

respond_to_w:
    # Actions for 'w' keypress
    # Set down enabled to 0
    
   check_double_jump:
    	lw $t0, DoubleJumpUsed       	
    	# Load the value of "DoubleJump" into register $t0
    	ble $t0, 1, double_jump  	
    	# If "DoubleJump" equals 0, branch to "set_double_jump"
    	j end_of_actions
    
   double_jump:
   	lw $t0, DoubleJumpUsed
	addi $t0, $t0, 1        	
	# Set register $t0 to the value 1
	sw $t0, DoubleJumpUsed       	
	# Store the value in $t0 to "DoubleJump" in memory
	la $t0, character_movement      
	# Load the address of character_movement into $t0
    	lw $t1, 12($t0)
    	sw $zero, 12($t0)               
    	# Store the value 0 at the "down enabled" element's address
    
    move_up:
    	# Move the character one pixel up
    	la $t0, character_movement    	
    	# Load the address of character_movement into $t0
    	lw $t1, 8($t0)             
    	beq $t1, 18, end_jump
    	
    	lw $t0, CharX
    	lw $t1, CharY
    	li $t4, CHAR_WIDTH
    	addi $t1, $t1, -1    		
    	# Get the Y value one above the character
    	li $t2, 0x10008000   		
    	# Load the base address of the bitmap
    	mul $t3, $t1, 128    		
    	# Calculate y_offset = y_position * 512
    	add $t3, $t3, $t0   		
    	# Calculate total_offset = y_offset + x_position
    	mul $t3, $t3, 4	     		
    	# starting address = total_offset * 4
    	add $t2, $t2, $t3    		
    	# Add the total_offset to the base address
    
    	mul $t4, $t4, 4

    	lw $t4, 0($t2)
    	bne $t4, 0x00000000, end_jump
    	add $t2, $t2, $t4
    	lw $t4, 0($t2)
    	bne $t4, 0x00000000, end_jump
    	
    	la $t0, CharY   		
    	# Load the address of CharX into $t0
    	lw $t1, 0($t0)  		
    	# Load the value stored at CharX into $t1
    	addi $t1, $t1, -1 		
    	# Increment the value in $t1 by 1
    	sw $t1, 0($t0)  		
    	# Store the updated value in $t1 back to CharX
    	
    	la $t0, character_movement    	
    	# Load the address of character_movement into $t0
    	lw $t1, 8($t0)             
    	addi $t1, $t1, 1	      	
    	# add 1 to the jump counter
    	sw $t1, 8($t0)
    
    
    j end_of_actions


end_jump:
    la $t0, character_movement   	
    # Load the address of character_movement into $t0
    li $t1, 1
    sw $t1, 12($t0)
    sw $zero, 8($t0)
    
    j end_of_actions
	
respond_to_s:
    # Actions for 's' keypress
    la $t0, character_movement  	
    # Load the address of character_movement array into $t0
    sw $zero, 0($t0)  			
    # Set character_movement[0] to 0
    sw $zero, 4($t0)  			
    # Set character_movement[1] to 0
    
    j end_of_actions

respond_to_p:
    # Actions for 'p' keypress
    la $t0, Screen    			
    # Load the address of Screen into $t0
    lw $t1, 0($t0)    			
    # Load the value stored at health into $t1
    li $t1, 1  				
    # Increase the value in $t1 by 1
    sw $t1, 0($t0)    			
    # Store the updated value in $t1 back to Screen
    	
    la $t0, Health    			
    # Load the address of Screen into $t0
    lw $t1, 0($t0)   			
    # Load the value stored at health into $t1
    li $t1, 3  				
    # Increase the value in $t1 by 1
    sw $t1, 0($t0)   	 		
    # Store the updated value in $t1 back to Screen
    
    j main

move_down:
   
    lw $t0, CharX
    lw $t1, CharY
    li $t4, CHAR_WIDTH
    add $t1, $t1, CHAR_HEIGHT
    li $t2, 0x10008000   		
    # Load the base address of the bitmap
    mul $t3, $t1, 128    		
    # Calculate y_offset = y_position * 512
    add $t3, $t3, $t0    		
    # Calculate total_offset = y_offset + x_position
    mul $t3, $t3, 4	 		
    # starting address = total_offset * 4
    add $t2, $t2, $t3    		
    # Add the total_offset to the base address

    li $t5, 0            		
    # Initialize the loop counter
    
    check_pixels_loop:
    bge $t5, 36, c  			
    # If the loop counter >= 36, jump to move_down_done

    lw $t6, 0($t2)
    
    li $v0, 34
    move $a0, $t6

    
    beq $t6, 0x004d6df3, damage_taken    
    # If water colour then call damage taken function
    beq $t6, 0x0037474f, next_level 
    # if the door then go to next level
    bne $t6, 0x00000000, move_down_done
    
    addi $t2, $t2, 4     		
    # Move to the next pixel on the right
    addi $t5, $t5, 4     		
    # Increment the loop counter by 4
    j check_pixels_loop  		
    # Jump back to check_pixels_loop
    
    c:
    la $t0, CharY   			
    # Load the address of CharX into $t0
    lw $t1, 0($t0)  			
    # Load the value stored at CharX into $t1
    addi $t1, $t1, 1 			
    # Increment the value in $t1 by 1
    sw $t1, 0($t0)  			
    # Store the updated value in $t1 back to CharX
    
    
    j end_of_actions

    move_down_done:
    	sw $zero, DoubleJumpUsed     	
    	# Store the value in $t0 to "DoubleJump" in memory
    	j end_of_actions
    	
# End of Check Press
end_of_actions:
    j sleep      			
    # Jumps back to location of function call
    

# Display Functions:

display_Screen:
    addi $sp, $sp, -16   		
    # Allocate space for 4 saved registers
    sw $ra, 12($sp)      		
    # Save return address
    sw $a0, 0($sp)       		
    # Save image pointer
    sw $a1, 4($sp)       		
    # Save width
    sw $a2, 8($sp)       		
    # Save height

    li $t2, 0x10008000   		
    # Load the base address of the bitmap
    mul $t3, $t1, 128    		
    # Calculate y_offset = y_position * 512
    add $t3, $t3, $t0    		
    # Calculate total_offset = y_offset + x_position
    mul $t3, $t3, 4	 		
    # starting address = total_offset * 4
    add $t2, $t2, $t3    		
    # Add the total_offset to the base address

    li $t4, 0            		
    # Row counter
    li $t5, 0            		
    # Column counter

    loop_row:
        beq $t4, $a2, exit_display 	
        # If all rows are processed, exit
	
    loop_col:
        beq $t5, $a1, next_row  	
        # If all columns are processed, go to the next row
	
        lw $t6, 0($a0)          	
        # Load pixel data from the image
        sw $t6, 0($t2)          	
        # Store pixel data to the screen memory
        
        addi $a0, $a0, 4
        addi $t2, $t2, 4
        
        addi $t5, $t5, 1        	
        # Increment column counter
        j loop_col

    next_row:
        addi $t4, $t4, 1        	
        # Increment row counter
        li $t5, 0               	
        # Reset column counter
        	
        add $t3, $t1, $t4
    	mul $t3, $t3, 128    		
    	# Calculate y_offset = y_position * 512
    	add $t3, $t3, $t0    		
    	# Calculate total_offset = y_offset + x_position
    	mul $t3, $t3, 4	     		
    	# starting address = total_offset * 4
    	addi $t2, $t3, 0x10008000
    	
        j loop_row
    
    exit_display:
    	lw $ra, 12($sp)      		
    	# Restore return address
    	addi $sp, $sp, 16    		
    	# Restore stack pointer
	
    	jr $ra               		
    	# Return from function

# Draw Character Function:
draw_panda:
    
    # Save the return address on the stack
    addi $sp, $sp, -4
    sw $ra, 0($sp)
    
    # Set up the arguments for display_Screen
    la $a0, panda   		
    # Replace image_start with the label of the image data in memory
    li $a1, CHAR_WIDTH           
    li $a2, CHAR_HEIGHT 
    lw $t0, CharX
    lw $t1, CharY        

    # Call display_Screen
    jal display_Screen
    
    # Restore the return address from the stack
    lw $ra, 0($sp)
    addi $sp, $sp, 4
	
    # Return from the function
    jr $ra



erase_panda:

    # Save the return address on the stack
    addi $sp, $sp, -4
    sw $ra, 0($sp)
    # Set up the arguments for display_Screen
    la $a0, panda_background   		
    # Replace image_start with the label of the image data in memory
    li $a1, CHAR_WIDTH           
    li $a2, CHAR_HEIGHT 
    lw $t0, OldX
    lw $t1, OldY        

    # Call display_Screen
    jal display_Screen

    # Restore the return address from the stack
    lw $ra, 0($sp)
    addi $sp, $sp, 4
	
    # Return from the function
    jr $ra
    
    
print_skull:

    la $a0, erase_skull   			
    # Replace image_start with the label of the image data in memory
    li $a1, 14           
    li $a2, 9
    lw $t0, skullX
    lw $t1, skullY        

    # Call display_Screen
    jal display_Screen
    
    lw $t0, skullX  				
    # Load the current value of "fireball_x" into register $t0
    addi $t0, $t0, -1     			
    # Add 1 to the value in $t0
    sw $t0, skullX   				
    # Store the updated value back to "fireball_x" in memory
    
    la $a0, skull   				
    # Replace image_start with the label of the image data in memory
    li $a1, 14         
    li $a2, 9
    lw $t0, skullX
    lw $t1, skullY  
    
    beq $t0, 0, reset_skull

    cont:
    # Call display_Screen
    jal display_Screen
    
    j continue

reset_skull:
	li $t0, 83
	sw $t0, skullX
	j cont
